<SCRIPT>
function OnBodyLoad()
{
	if(window.parent != window)
	{
		window.parent.location.href="login.htm";
		return;
	}
	InitLangSelection();
	
	document.title=GS("LOGIN");
	Login.value=GS("LOGIN");
	LoginMobile.value=GS("LOGIN_MOBILE");
	var bRememberMe = GetCookie('bRememberMe');
	if(bRememberMe=="1")
		chkRememberMe.checked=true;
	if(chkRememberMe.checked)
	{
		var szUsr=GetCookie('userLastLogin');
		if(szUsr != "undefined")
			usr.value=szUsr;
		var szPwd=GetCookie('passwordLastLogin');
		if(szPwd != "undefined")
			pwd.value=szPwd;
	}
	
	//auto login
	var szUsr = GetPageParams("user","")+"";
	var szPwd = GetPageParams("password","")+"";
	if(szUsr=="") szUsr=GetPageParams("usr","")+"";
	if(szPwd=="") szPwd=GetPageParams("pwd","")+"";
	var szLoginMobile = GetPageParams("loginmode","0");
	if(szUsr!="" || szPwd !="")
	{
		usr.value=szUsr;
		pwd.value=szPwd;
	
		if(szLoginMobile == "1")
			SubmitSmartPhone.click();	
		else
			Login.click();	
	}
	usr.focus();
	
	GetXml("devinfo.xml",OnGetXmlOK,OnGetXmlFail);
}

function OnGetXmlOK(xml)
{
	var Result = xml.getElementsByTagName("Result")[0];
	var DevName=XmlGetValue(Result,"Name");
	var Greeting=XmlGetValue(Result,"Greeting");
	if(Greeting=="")
		Greeting=GS("GREETING");
	spanGreeting.innerHTML=Greeting;
	document.title=DevName;
}
function OnGetXmlFail(xml){}
function set_language(lng)
{
	SetCookie('language',lng);
	location.reload(false);
}
function OnRememberMe()
{
	if(document.getElementById("chkRememberMe").checked)
	{
		SetCookie('bRememberMe',"1");
		var frm = document.forms[0];
		SetCookie('userLastLogin',usr.value);
		SetCookie('passwordLastLogin',pwd.value);
	}
	else
	{
		SetCookie('bRememberMe',"0");
		SetCookie('userLastLogin',"");
		SetCookie('passwordLastLogin',"");
	}
}

var g_loginType=0;
function StartLogin(loginType)
{
	g_loginType=loginType;
	
	OnRememberMe();
	Login.disabled=1;
	LoginMobile.disabled=1;
	//usr,pwd for back compatible
	var param="user="+encodeURIComponent(usr.value)
	+"&usr="+encodeURIComponent(usr.value) 
	+"&password="+encodeURIComponent(pwd.value)
	+"&pwd="+encodeURIComponent(pwd.value)
	;
	GetXml("login.xml?"+param,OnLoginAckOK,OnLoginAckFail);
	SetAjaxStatus(GS("LOGINING"),0);
}
function OnNormalLogin()
{
	StartLogin(0);
}

function OnLoginMobile()
{
	StartLogin(1);
}
function OnLoginIPad()
{
	StartLogin(2);
}

function OnLoginAckOK(xml)
{
	Login.disabled=0;
	LoginMobile.disabled=0;
	var bLoginOK=0;
	var Result = xml.getElementsByTagName("Result")[0];
	var user_level=XmlGetValue(Result,"UserLevel");
	if(user_level!="-1")
	{
		bLoginOK=1;
		SetAjaxStatus(GS("LOGIN_OK"),2);
		if(g_loginType==1)
		{
			location.href="mobile.htm";
			//alert("mobile.htm");
		}
		else if(g_loginType==2)
		{
			location.href="ipad.htm";
			//alert("mobile.htm");
		}
		else
		{
			location.href="index.htm";
			//alert("index.htm");
		}
	}
	if(bLoginOK != 1)
		SetAjaxStatus(GS("LOGIN_FAIL"),0);
}
function OnLoginAckFail(xml){}
function OnExitApp()
{
	GetXml("exitapp.xml",OnExitAppAckOK,OnExitAppAckFail);
}
function OnExitAppAckOK(xml){}
function OnExitAppAckFail(xml){}
function OnKeyDown(event)
{
	if(event.keyCode==0x0D)
		OnNormalLogin();
}
